Putting all of the above together yields a minimal application. A window is created, and the application will exit when the window is closed. package main import ( "github.com/pekim/gobbi/lib/gtk" "os" "runtime"
) func init() { runtime.LockOSThread()
} func main() { gtk.Init(os.Args) window := gtk.WindowNew(gtk.GTK_WINDOW_TOPLEVEL) window.Widget().ConnectDestroy(gtk.MainQuit) window.Widget().ShowAll() gtk.Main()
}
